# Register a font that supports Arabic
def register_arabic_font():
    font_name = "Amiri"
    font_path = "trash/Amiri/Amiri-Regular.ttf"  # Replace with your font path
    pdfmetrics.registerFont(TTFont(font_name, font_path))
    return font_name


def preprocess_png_for_reportlab(png_path):
    img = Image.open(png_path).convert("RGBA")
    white_bg = Image.new("RGB", img.size, (255, 255, 255))
    white_bg.paste(img, mask=img.split()[3])
    processed_path = png_path.replace(".png", "_processed.png")
    white_bg.save(processed_path, "PNG")
    return processed_path


def format_text_for_language(text):
    if any("\u0600" <= char <= "\u06FF" for char in text):
        reshaped_text = reshape(text)
        return get_display(reshaped_text)
    return text


def generate_pdf(data):
    
    font_name = register_arabic_font()  # Register Arabic-compatible font
    c = canvas.Canvas("output.pdf", pagesize=letter)
    c.setFont(font_name, 12)  # Set the Arabic font for the document
    width, height = letter

    y_position = height - 40
    line_height = 14

    # Add a title
    c.setFont(font_name, 16)
    c.drawString(30, y_position, "Form Data")
    y_position -= 30

    acc_api = ACCAPI()
    svg_codes = []
    for custom_value in data["customValues"]:
        if custom_value.get("svgVal"):
            svg_codes.append(acc_api.decode_svg(custom_value["svgVal"]))

    x = 300
    y = 500
    for svg in svg_codes:
        unique_filename = f"processed_image_{uuid.uuid4().hex}"
        processed_png_path = preprocess_png_for_reportlab(acc_api.convert_svg_to_png(svg, output_path=unique_filename))
        c.drawImage(processed_png_path, x, y, width=100, height=100)
        x += 100
        y += 100

    # Loop through the data and add it to the PDF
    c.setFont(font_name, 12)

    # Assignee details
    created_by_user = acc_api.call_api(f"construction/admin/v1/projects/{acc_api.CONTAINER_ID}/users/{data['createdBy']}")
    locations = acc_api.call_api(f"construction/locations/v2/projects/{acc_api.CONTAINER_ID}/trees/default/nodes")['results']
    form_location = None
    created_at = data['createdAt']  
    date_object = datetime.strptime(created_at, '%Y-%m-%dT%H:%M:%S.%f%z')
    formatted_created_at_date = date_object.strftime('%b %d, %Y')
    form_template = data['formTemplate']
    form_description = data['description']
    due_date = data['dueDate']
    date_object = datetime.strptime(due_date, '%Y-%m-%d')
    formatted_due_date = date_object.strftime('%b %d, %Y')
    form_status = data['status']
    form_last_updated_date = data['updatedAt']
    date_object = datetime.strptime(form_last_updated_date, '%Y-%m-%dT%H:%M:%S.%f%z')
    formatted_last_updated_at_date = date_object.strftime('%b %d, %Y')
    form_custom_values = data['customValues']
    latest_updated_by = None
    latest_updated_at = None
    
    for item in form_custom_values:
        updated_at = item.get("updatedAt")
        if updated_at:
            updated_at = datetime.fromisoformat(updated_at)  # Parse the updatedAt timestamp
            if latest_updated_at is None or updated_at > latest_updated_at:
                latest_updated_at = updated_at
                latest_updated_by = item.get("updatedBy")
                
    latest_updated_by_user = acc_api.call_api(f"construction/admin/v1/projects/{acc_api.CONTAINER_ID}/users/{latest_updated_by}")


    grouped_by_section = defaultdict(list)

    for item in form_custom_values:
        grouped_by_section[item.get("sectionLabel")].append(item)
        
    print(grouped_by_section)
    

    for location in locations:
        if location['id'] == data['locationId']:
            form_location = location
            break
    
    
  

    c.save()


